V8:
Çox TəciliI Satilir !!!

Son qiymətdə razılaşmaq olar!

Bina Səbail rayonu Badamdar qəsəbəsin mərkəzində yerləşir • Leninqrad layihəli (proyekt) • Daş evidi • Mənzil ipotekaya yararlidir.
— Mənzilin hundurluyu 2.70 metre;
— Mənzil ortadi ve yelçəkəndi;
— Evin arxa tərəfindən qaraja çixişı var;
— Maşin üçün qaraj var (qiymətinə daxildir)

— Su, işiq, merkezi istilik var;
— Iki su baki var;
— Internet, telefon mövcuddu;
— Kondisioner var;
— Çıxarış var;

— Binadan 5 deq. məsafədə marketler yerleşir: Bizim, Bazar Store, Araz ve s.;
— Binanin qabaģinda uşaq baxçasi var;
— Binadan 10 deq. məsafədə iki orta məktəb var;
— Yaxinliqda 3 №-li, 31 №-li, 53 №-li ve 29 №-li marşrutlarin avtobus dayanacaģı;

Son qiymətdə razılaşmaq olar!

Çox TəciliI Satilir !!!

İstənilən vaxt zəng edin.
